import React from 'react';
import { View, ViewStyle } from 'react-native';

interface SquareContainerProps {
    size: number;
    children: React.ReactNode;
    style?: ViewStyle;
}

const SquareContainer: React.FC<SquareContainerProps> = ({ size, children, style }) => {
    return (
        <View style={{
            position: 'absolute',
            top: 20,
            left: 20,
            width: size,
            height: size,
            backgroundColor: 'red',
            borderRadius: 10,
            padding: 20,
            shadowColor: 'black',
            shadowOffset: { width: 0, height: 2 },
            shadowOpacity: 0.8,
            shadowRadius: 2,
            elevation: 5,
            ...style,
        }}>
            {children}
        </View>
    );
};

export default SquareContainer;
